versioning:
  repository: 'https://github.com/rloic/aes-4-rounds-rust/'
  commit: ccfc651a48808e7fe923d4c5ee0b3ec10a08dfee
compile: 'cargo build --release'
# arguments:
#   ip: Input position (position of the active byte at round 0)
#   iv: Input value
#   op: Outpout position (position of the active byte at round 5)
#   ov: Output value
#   sbv: Value of the output sbox transition (iv -> sbv)
#   d: Delay to print informations and stats (can be in (m)inutes, (s)econds or (h)ours))
execute: './target/release/aes-4-rounds ip=1:0 iv=0xCB op=3:3 ov=0xCF d=1h'
iterations: 1
measures: []
stats:
  - time
nb_threads: 4
timeout:
